Here’s why you should go see @appletv Killers of the Flower moon- Native Representation! This film addresses the violence that Osage natives were experiencing during the early 1900’s. Natives are shown respectfully, and their story told with reverence. I thought it was well done and as a native woman, it was hard to watch - but absolutely necessary. You’ll see native faces like @tantoocardinal @lilygladstone @janaedawnnn @cara.jade.myers @tatankameans @_jilliandion @vancitywilliambelleau - please don’t miss this film and I hope we see more native stories and faces going forward. Full review is on the 🕰 app link: https://www.tiktok.com/@recycldstardust/video/7291691031358311726
