The basics. You can do so much with a simple legging and black top. These are truly essentials for a reason. Now, the problem is many people stop right there- but don’t! This is the Opportunity to show your style. Pair with a jacket, shrug, scarf, even a poncho. Whatever suits your style. Add interesting shoes or a belt, a chain, anything that makes the look a little more interesting. For me, I like to play on color. This floral satin blazer, with shoes and a bag that pull color from it keeps it simple but put together. Build your closet with pieces that flow and can be paired together. Don’t be afraid to add some color. Follow me for more styling tips 💕
